import React from 'react';
// import ReactDOM from 'react-dom';
// import Footer from './Components/Footer';
import './App.css';
import './index.css';
import Products from './Components/Products';
import Contact from './Components/Contact';
import './styles.css';

const states = {
  currentPage: 'Products',
  sliderPage: 'Shop Mens',
};

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      ...states
    };
  }


  render() {
    return (
      <div>
          <NavBar />
        {this.state.currentPage === 'Home' &&
          <Main />  
        }
        {this.state.currentPage === 'Products' &&
          <Products />
        }
        {this.state.currentPage === 'Contact' &&
          <Contact />
        }
      </div>
    );
  };
};


class NavBar extends React.Component {
  onPageChange = (pageName) => {
    return (
    console.log('onPageChange', pageName)
    )
  };
  render() {
    return (
      <nav className="navbar navbar-expand-lg fixed-top">
        <button className="navbar-toggler " type="button" data-toggler="collapse" data-target="navagation-bar" onclick="myFunction()">
          <span className="navbar-toggler-icon">&#9776;</span>
        </button>
        <div class="collapse navbar-collapse" id="navigation-bar">
          <ul class="navbar-nav ml-auto">
            <li class="nav-item"> <a class="nav-link" onClick={this.onPageChange('Home')} href="index.js">HOME</a></li>
            <li class="nav-item"> <a class="nav-link" onClick={this.onPageChange('Products')} href="Products.js">PRODUCT</a></li>
            <li class="nav-item"> <a class="nav-link" onClick={this.onPageChange('Contact')} href="Contact.js">CONTACT</a></li>
          </ul>
        </div>
      </nav>
    )
  }
}


    class Pricing extends React.Component {
      render() {
        return (
          <div>
            <div>
              <h2>Subscribe</h2>
              <hr/>
              <p className="lead">Sign up for weekly updates on upcoming deals and free, unlimited shipping!!</p>
              <p className="lead">Buy a plan </p>
            </div>
                <div className="card-price">
                <div className="card-header">Basic</div>
                  <ul className="list-group list-group-flush">
                    <li className="list-group-item"><strong>5-7</strong> day shipping</li>
                    <li className="list-group-item"><strong>$5</strong> off first purchase</li>
                    <li className="list-group-item"><strong>$5.99</strong>a month</li>
                  </ul>
                    <div className="card-body">
                      <button type="button" className="btn btn-outline-info btn-block">Sign up</button>
                    </div>
                </div>
          </div>
        )
      }
